//import { authRoles } from 'app/auth';
import i18next from 'i18next';
import en from './navigation-i18n/en';
i18next.addResourceBundle('en', 'navigation', en);
const navigationConfig = [
	{
		id: 'applications',
		title: 'dashboard',
		translate: 'PRINCIPAL',
		type: 'item',
		icon: 'dashboard',
		url: '/apps/dashboards/project'
	},
	{
		id: 'GestionGAES',
		title: 'Gestion GAES',
		translate: 'Gestion GAES',
		type: 'item',
		icon: 'group',
        url: '/apps/academy/Course'
	},
	{
		id: 'GestionTercero',
		title: 'Gestion Tercero',
		translate: 'Gestion Tercero',
		type: 'item',
		icon: 'person_pin',
		url: '/apps/academy'
	},
	{
		id: 'crearempresa',
		title: 'Creacion Empresa',
		translate: 'Creacion Empresa',
		type: 'item',
		icon: 'business',
		url: '/apps/empresa'
	},
	{
		id: 'gContable',
		title: 'Gestión Empresa',
		type: 'collapse',
		icon: 'all_inbox',
		children: [
			{
				id: 'mNegocio',
				title: 'Modelo de Negocio',
				type: 'item',
				url: '/pages/invoices/modern'
			},
			{
				id: 'infBasica',
				title: 'Información Basica',
				type: 'item',
				url: '/pages/invoices/compact'
			},
			{
				id: 'plnEstratégica',
				title: 'Planeación Estratégica',
				type: 'item',
				url: '/pages/invoices/compact'
			},
			{
				id: 'actproserv',
				title: 'Activos, Productos y Proveedores',
				type: 'item',
				url: '/pages/invoices/compact'
			},
			/* {
				id: 'styleProveedores',
				title: 'Proveedores',
				type: 'item',
				url: '/pages/invoices/compact'
			}, */
		]
	},
	{
		id: 'Contable',
		title: 'Gestión Contable',
		type: 'collapse',
		icon: 'assessment',
		children: [
			{
				id: 'style-Ventas',
				title: 'Ventas',
				type: 'item',
				url: '/pages/pricing/style-1'
			},
			{
				id: 'style-Egresos',
				title: 'Egresos',
				type: 'item',
				url: '/pages/pricing/style-2'
			},
			{
				id: 'style-Nomina',
				title: 'Nomina',
				type: 'item',
				url: '/pages/pricing/style-3'
			}
		]
	},
];

export default navigationConfig;
